import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the cart element using text selector (since class is generic)
    // Use text selector for "Cart" with number, e.g., "Cart" or "0 Cart"
    const cartSelector = 'text=/\\d+\\s*Cart/';
    await page.waitForSelector(cartSelector, { timeout: 5000 });

    // Click the cart area to open the cart modal
    await page.click(cartSelector);

    // Wait for the cart modal to appear: look for modal with cart content, e.g. h2 "Shopping Cart" or "Your Cart"
    // The modal is .modal[style*="display: block"] or #cartModal (from script.js logic)
    // Wait for a visible modal with class .modal and a child with h2 or class .cart-content
    // We'll use XPath to find a visible modal with "Cart" in the heading
    const modalXPath = '//div[contains(@class,"modal") and contains(@style,"display: block")]//h2[contains(text(),"Cart")] | //div[contains(@class,"modal") and contains(@style,"display: block")]//div[contains(@class,"cart-content")]';
    await page.waitForSelector(modalXPath, { timeout: 5000 });

    // Take screenshot of the cart modal open
    const modalShot = path.join(screenshotsDir, 'step_2_cart_modal_open.png');
    await page.screenshot({ path: modalShot });
    screenshots.push(modalShot);

    // Extract cart modal visible status and cart item count (if any)
    const cartModalVisible = await page.evaluate(() => {
      const modals = Array.from(document.querySelectorAll('.modal'));
      return modals.some(modal => getComputedStyle(modal).display === 'block');
    });

    // Extract number of items in cart (from .cart element text)
    const cartCountText = await page.$eval('.cart', el => el.textContent);
    const cartCountMatch = cartCountText.match(/\d+/);
    const cartCount = cartCountMatch ? parseInt(cartCountMatch[0], 10) : 0;

    return {
      success: true,
      action: "Opened the shopping cart modal and verified its visibility",
      extractedData: {
        cartModalVisible,
        cartCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
